import React from 'react';
import { Link } from 'react-router-dom';
import style from './DropDownMenu.css';
import createPinPage from '../../page/PayBillsPage/CreatePinPage';
import source1Page from '../../page/PayBillsPage/Source1Page';
import source2Page from '../../page/PayBillsPage/Source2Page';



function DropdownMenu () {
  return (
    <div className="dropdown-menu">
      <Link to='../../page/PayBillsPage/CreatePinPage' className={style.dropdown-item}>Create Pin</Link>
      <Link to="/paybill/source1" className={style.dropdown-item}>Source 1</Link>
      <Link to="/paybill/source2" className={style.dropdown-item}>Source 2</Link>
    </div>
  );
}
export default DropdownMenu;
